import React, {use, useEffect, useState} from 'react'
import Nav from '../Components/Nav'
import AccountComponent from '../Components/BankComponentv2'
function Accounts() {
    const [bankRaw, setBankRaw] = useState([])
    useEffect(()=>{
        fetch('/api/banks')
        .then(r=>r.json())
        .then(data=>setBankRaw(data))
    },[])



  return (
    <div>
        <AccountComponent bankRaw = {bankRaw}/>
    </div>
  )
}

export default Accounts
